import React from "react";
import {motion} from "framer-motion"

const loaderVariants = {
    animationOne:{
        x: [-20, 20],
        y: [0, -30],
        transition:{
            x: {
                yoyo: Infinity,
                duration: 0.5
            },
            y: {
                yoyo: Infinity,
                duration: 0.25
            }
        }
    }
}

const Loader=()=>{
    <>
        <motion.div className="loader"
            variants={loaderVariants}
            animate="animationOne"
        >

        </motion.div>
    </>
}

export default Loader
